const axios = require('axios');

const generateNft = async (_nftParams) => {

    console.log("....")
    try{
        const link = await axios.get(`http://localhost:3001/?aiParams=${_nftParams}`);
        console.log(link.data);
        return(link.data);
    }
    catch(err){
        return false;
    }

}

generateNft("Red ape");
